import React, { useState } from 'react'

export default function Card({ item }) {
	return (
		<div className='card'>
			<div className='card--title'>
				<p>{item.name}</p>
			</div>
			<div className='card--img'>
				<img src={item.photo} alt='Item_photo' />
			</div>
		</div>
	)
}
